{
    "PC": {
        "wrapper": "getNormalTableMount",
        "className": [
            {
                "value": "'tdesign-class'",
                "expect": [
                    {
                        "dom": "tbody > tr",
                        "className": {
                            "tdesign-class": true
                        }
                    }
                ]
            },
            {
                "value": "{ 'tdesign-class': true, 'tdesign-class-next': false }",
                "expect": [
                    {
                        "dom": "tbody > tr",
                        "className": {
                            "tdesign-class": true,
                            "tdesign-class-next": false
                        }
                    }
                ]
            },
            {
                "value": "['tdesign-class-default', { 'tdesign-class': true, 'tdesign-class-next': false }]",
                "expect": [
                    {
                        "dom": "tbody > tr",
                        "className": {
                            "tdesign-class-default": true,
                            "tdesign-class": true,
                            "tdesign-class-next": false
                        }
                    }
                ]
            },
            {
                "value": "() => ({ 'tdesign-class': true, 'tdesign-class-next': false })",
                "expect": [
                    {
                        "dom": "tbody > tr",
                        "className": {
                            "tdesign-class": true,
                            "tdesign-class-next": false
                        }
                    }
                ]
            }
        ]
    }
}

